import React from "react";
import "./login.css";
import { Link } from "react-router-dom";
import "./home"
import "./signup"
import "./password"

const Login = () => {
  return (
    <div className="page">
      <div className="bg">
        <span className="enter">LOGIN</span>
        <form>
        <div className="forms">
        <span className="name">NAME</span>
        <input type="text" className="name1"></input><br></br>
        <span className="password">PASSWORD</span>
        <input type="password" className="password1"></input><br></br>
        <span className="phone">PHONE NO</span>
        <input type="number" className="phone1"></input><br></br>
        </div>
        </form>
        <a><Link to="/Home"><div className="sign"><button className="box">SIGN IN</button></div></Link></a>
        <div className="flex">
        <div><button className="box1">Create an account!</button></div>
        <div><button className="box2">Forgot password?</button></div>
        </div>
      </div>
    </div>
  );
};
export default Login;
